import React from "react";
import styles from "./Nasa.module.css";

const Nasa = () => {
  return (
    <section className={styles.section}>
      <div className={styles.container}>
        <h1 className={styles.title}>The science behind BreatheSafetyIndex</h1>
        <div className={styles.textImageWrapper}>
          {" "}
          <p className={styles.aboutText}>
            Leveraging research from leading institutions and backed by a team
            of experts in public health, environmental science, and data
            analytics, BreatheSafetyIndex assesses disease risks with
            unparalleled accuracy. Our model evaluates the effect of air quality
            on seven key health systems, offering unique insights into the
            environmental factors impacting human health.
          </p>
          <img src="./Nasa.png" alt="Фото" className={styles.image} />
        </div>
      </div>
    </section>
  );
};

export default Nasa;
